import ContactsForm from './components/ContactsForm.vue';

const routes = [
  // {
  //   name: 'lang',
  //   path: "/:lang",
  //   component: ContactsForm,
  // },
  {
    name: 'projects',
    path: "/projects",
    component: ContactsForm,
    meta: {
     nameRus: "Проекты",
    }
  },
  {
    name: 'about',
    path: "/about",
    component: ContactsForm,
    meta: {
     nameRus: "О компании",
    }
  },
  {
    name: 'contacts',
    path: "/contacts",
    component: ContactsForm,
    meta: {
     nameRus: "Контакты",
    }
  },
  {
    path: "*",
    redirect: "/contacts",
  },
];

export default routes;
